import { AlertTriangle } from 'lucide-react'; // Optional: Replace with your SVG or use an actual image
import React from 'react';

export default function SessionManagement() {
  return (
    <div className="max-w-md mx-auto p-6 bg-white rounded-lg shadow-md space-y-6">
      {/* Header */}
      <div className="flex items-center space-x-4">
        <AlertTriangle className="text-red-600" size={24} />
        <h2 className="text-lg font-bold text-gray-900">Session Management</h2>
      </div>

      {/* Content */}
      <div className="space-y-4">
        <div>
          <h3 className="text-md font-semibold text-gray-800">End Current Session</h3>
          <p className="text-sm text-gray-600 mt-1">
            Log out from this device and return to login screen. All unsaved changes
            will be lost.
          </p>
        </div>

        {/* Logout Button */}
        <button className="w-full bg-red-600 hover:bg-red-700 text-white font-bold py-2 px-4 rounded-md transition">
          LOGOUT
        </button>
      </div>
    </div>
  );
}
